import { combineReducers } from 'redux';
import {
  getClickedUserReducer,
  getUserReducer,
  userReducer,
} from './userReducers';

export default combineReducers({
  user: userReducer,
  searchedUser: getUserReducer,
  clickedUser: getClickedUserReducer,
});
